import React,{Component} from 'react';
import Client from '../consulta';
import TodoLabel from '../../src/componentes/biceLabel';
import '../../src/App.css'


var _ = require('lodash');

class Forma extends Component {
    constructor(props) {
      super(props);

      this.state = {
            name:'',
            salida:'',
            value: '',
            valor:'',
            persona:{ 
                nick: '',
                msg: '',
                created: { type: '', default: '' }
                },

            };
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
      this.handleInputChangeM= this.handleInputChangeM.bind(this);
    }
  
    handleChange(event) {
      this.setState({value: event.target.value});
    }
  
    handleSubmit(event) {
        let parte=JSON.stringify(this.state.value);
        if(this.state.value){
            Client.search("{ nick:"+parte+" }", respuesta => {
                let guarda = (JSON.parse(respuesta));
                // this.setState( {salida:guarda}); 
                // this.refs.someName.value = '';
            });      
       }
      event.preventDefault();
    }

    // handleSubmitM(e) {
    //     e.preventDefault();
    //     this.props.onAddTodo(this.state);
    //     this.setState({
    //       title: '',
    //       responsible: '',
    //       description: '',
    //       priority: 'low'
    //     });
    //   }
    
      handleInputChangeM(e) {
        e.preventDefault();
        const {value, name} = e.target;
        const esto='{"pide":"' + value+ '" }'
        //Client.search("{ busque:"+value+" }", respuesta => {
          Client.search(esto, respuesta => {
            this.setState({
                name: respuesta
              });
      
        });      
      }

    render() {

      let options3= this.state.salida;
      let muestra= this.state.name;
      let myobj = eval( muestra );
      let esto = {key:'', name:'', unit:'', date:'', value:''}

      if (myobj) esto = myobj[0]

      return (

        <div className="card text-center border-info">

            <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                        <a className="nav-link" href="/">menu1</a>
                        </li>
                        <li className="nav-item">
                        <a className="nav-link" href="/">menu2</a>
                        </li>
                    </ul>
            </nav>

             <div className="row">
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Indicadores</h5>
                            <p className="card-text">Indicadore simportante busyness</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a indicadores</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Graficas</h5>
                            <p className="card-text">Graficas de indicador Dolar</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a graficas</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Curriculum</h5>
                            <p className="card-text">Mostrar Curriculum 2020</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a curriculum</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Bajo Construccion</h5>
                            <p className="card-text">En Construccion</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a construccion</button>
                            </form>
                        </div>
                        </div>
                    </div>

               </div>

                    <div className="col-sm-8">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Bajo Construccion</h5>
                            <p className="card-text">wow</p>

                        <select
                            name="priority"
                            className="form-control"
                            value={this.state.priority}
                            onChange={this.handleInputChangeM}
                        >
                            <option>cobre</option>
                            <option>dolar</option>
                            <option>euro</option>
                            <option>ipc</option>
                            <option>ivp</option>
                            <option>oro</option>
                            <option>plata</option>
                            <option>uf</option>
                            <option>utm</option>
                            <option>yen</option>      
                        </select>

                        <div className="card-body" className="col-sm-2">
                        <button className="badge badge-pill badge-dander ml-2" type="submit">Acciones</button>
                                <span className="badge badge-pill badge-dander ml-12">Nombre</span>
                                <button className="btn btn-primary">{esto.name}</button>
                                <span className="badge badge-pill badge-dander ml-12">Unidad</span>
                                <button className="btn btn-primary">{esto.unit}</button>
                                <span className="badge badge-pill badge-dander ml-12">fecha</span>
                                <button className="btn btn-primary">{esto.date}</button>
                                <span className="badge badge-pill badge-dander ml-12">valor</span>
                                <button className="btn btn-primary">{esto.value}</button>
                        </div>


                        </div>
                        </div>
                    </div>

<div className="card text-white bg-primary mb-3" >
  <div className="card-header">Final cabecera</div>
  <div className="card-body">
    <h5 className="card-title">Titulo Bice</h5>
    <p className="card-text">Algo que decir</p>
